import React from "react";
import {Carousel} from "react-bootstrap";


const CarouselContainer = () => {
    return(
        <carousel control={false} fade={true} pause={false}> 
        <Carousel.Item interval={2000}>
        <img className="d-block w-100" src="https://vismaifood.com/storage/app/uploads/public/e12/7b7/127/thumb__1200_0_0_0_auto.jpg"
         alt=" Delicious quality chicken Biriyani" >
              </img>
        </Carousel.Item>
        <Carousel.Item interval={2000}> 
        <img  className="d-block w-100" src=" https://c.ndtvimg.com/2018-10/ohqcobr_handibiryani_625x300_08_October_18.jpg"      
         alt="Protien Rich Biriyani" >
        </img>
       </Carousel.Item>
     </carousel>

    )
};

export default CarouselContainer
